def strip_characters(input_string):
    # Define the characters to strip
    characters_to_strip = ['[', ']', ' ', ',']

    # Iterate through the characters and remove them from the input string
    for char in characters_to_strip:
        input_string = input_string.replace(char, '')

    return input_string

